import React from 'react'
import ExpansionPanel from '@material-ui/core/ExpansionPanel';

export default class AdminPanel extends React.Component {
    render() {
        return(
            <ExpansionPanel TransitionProps={{ unmountOnExit: true }} />
        )
    }
}
